import Form from "react-bootstrap/Form";
import React from "react";
import Button from "react-bootstrap/Button";
import { useNavigate } from "react-router";
import { Card } from "react-bootstrap";
import { motion } from "framer-motion";

const SignIn = () => {
  const navigate = useNavigate();

  const GoToSignUp = () => {
    navigate("/signup");
  };

  const GoToMemberPage = () => {
    navigate("/memberpage");
  };

  return (
    <div className="background_signin">
      <motion.div
        initial={{ y: "5vh" }}
        animate={{ y: 0 }}
        transition={{ duration: 1, type: "spring", stiffness: 100 }}
      >
        <Card
          border="success"
          style={{ width: "24rem" }}
          className="card_signin"
        >
          <Card.Header className="cityty_style">Cityty</Card.Header>
          <Card.Body style={{ width: "14rem" }} className="card_body">
            <Form size="lg">
              <Form.Group className="mb-3" controlId="formGroupEmail">
                <Form.Control type="email" placeholder="Enter email"/>
              </Form.Group>
              <Form.Group className="mb-3" controlId="formGroupPassword">
                <Form.Control type="password" placeholder="Password" />
              </Form.Group>
            </Form>
            <div className="container-button_form">
              <Button
                variant="link"
                className="button_form"
                onClick={() => GoToMemberPage()}
              >
                Sign In
              </Button>
              <Button
                variant="link"
                className="button_form"
                onClick={() => GoToSignUp()}
              >
                Sign Up
              </Button>
            </div>
          </Card.Body>
        </Card>
      </motion.div>
    </div>
  );
};

export default SignIn;
